import React from "react";
import { Drawer } from "antd";
import { CustomizedForm } from ".";
const CusomDrawer = ({
  visible,
  title,
  onClose,
  onhandleAdd,
  firsItem,
  secondItem,
  thirdItem,
  fourthItem
}) => {
  return (
    <Drawer title={title} width={380} visible={visible} onClose={onClose}>
      <CustomizedForm
        personal
        dishpanel={false}
        firsItem={firsItem}
        secondItem={secondItem}
        thirdItem={thirdItem}
        fourthItem={fourthItem}
        fiveItem={"Password"}
        sixItem={"Phonenumber"}
        sevenItem={"Work Position"}
        eightItem={"Age"}
        nineItem={"Salary"}
        tenItem={"EMail"}
        elevenItem={"Date"}
        onClose={onClose}
        onhandleAdd={onhandleAdd}
      />
    </Drawer>
  );
};

export default CusomDrawer;
